// import reactRouterDom from 'react-router-dom';
// import './App.css';



import Nav from './Nav';
import HomeRecipes from './HomeRecipes';
import Recipe from './Recipe';

import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <Router className={'overscroll-none'}>
    <div className={"App px-10 py-6 bg-floralwhite overflow-y-hidden overscroll-none"}>

      <Nav className />
      <Switch>
        <Route exact path="/">
          <HomeRecipes/>
        </Route>

        <Route exact path='/african'>
          <Recipe type={'African'}/>
        </Route>

        <Route exact path='/american'>
          <Recipe type={'American'}/>
        </Route>

        <Route exact path='/chinese'>
          <Recipe type={'Chinese'}/>
        </Route>

        <Route exact path='/european'>
          <Recipe type={'European'}/>
        </Route>

        <Route exact path='/spanish'>
          <Recipe type={'Spanish'}/>
        </Route>

        <Route path="/recipe/:id">
          <Recipe  />
        </Route>

      </Switch>
    </div>
    </Router>
  )
}

export default App;
